import { WizardLayout } from '../components/WizardLayout';
import { Steps } from '../components/Steps';
import { Options } from '../components/Options';

const Pay = () => (
  <WizardLayout title="Araka | Payment">
    <Steps />
    <Options />
  </WizardLayout>
);

export default Pay;
